issue.body:
So I found out that:

```javascript
#!/usr/bin/env node

import { BlockWorker } from '../Workers';
import config from '../config';
// ...
```

gives a spaced-comment error, while this does not:

```javascript
#!/usr/bin/env node

import config from '../config';
import { BlockWorker } from '../Workers';
// ...
```

See https://github.com/eslint/eslint/issues/3296
